import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';
import {App} from './App';
import styled from 'styled-components';


let Post = styled.div(props => ({
    border: '2px solid',
    padding: '0.5em',
    cursor: "pointer"
}));

function Posts(props) {
  return <ul>
    {props.posts.map(post => {
      return <Post style={postStyle} key={post.id} onClick={() => props.onSelectPost(post.id)}>
      {post.title} ({post.id})
      </Post>
    })}
  </ul>
}


ReactDOM.render(
  <App />,
  document.getElementById('root')
);
